îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ‚îÅ usa constantes emp√≠ricas
            # Range (0.3, 0.7) garante m√≠nimo de cada componente (estrutura e criatividade)
            from src.consciousness.phi_constants import PSI_ALPHA_MIN, PSI_ALPHA_MAX

            # Phi alto (0.8) -> alpha = 0.7 (confia mais em Gaussian)
            # Phi baixo (0.1) -> alpha = 0.3 (confia mais em criatividade)
            alpha = float(np.clip(phi_norm * 10.0, PSI_ALPHA_MIN, PSI_ALPHA_MAX))
        else:
            # Fallback: usar 0.5 se phi_raw n√£o fornecido
            alpha = 0.5
            self.logger.debug("PsiProducer: phi_raw n√£o fornecido, usando alpha=0.5 (fallback)")

        psi_raw = alpha * psi_gaussian + (1.0 - alpha) * psi_from_creativity

        # 8. Normalizar para [0, 1] com clipping
        psi_norm = self._normalize_psi(psi_raw)

        # Criar componentes
        components = PsiComponents(
            innovation_score=innovation_score,
            surprise_score=surprise_score,
            relevance_score=relevance_score,
            entropy_of_actions=entropy_of_actions,
        )

        # Registra desempenho para ajuste din√¢mico de alpha
        self._record_performance(psi_norm, psi_from_creativity, psi_gaussian, alpha)

        return PsiResult(
            psi_raw=psi_raw,
            psi_norm=psi_norm,
            components=components,
            step_id=step_id,
        )
